import { BrowserRouter, Route } from "react-router-dom";
import "./App.css";
import StartPage from "./pages/StartPage/StartPage";

function App() {
  return (
    <BrowserRouter>
      <Route path="/" element={<StartPage />} />
    </BrowserRouter>
  );
}

export default App;
